Surround yourself with people who see your potential and refuse to let you settle for anything less. The ones who not only say your name in a room full of opportunities… but also build those dreams alongside you.

Those friendships are one in a million and are worth cherishing.

@rebecca.shostak you are one of those people for me 💕 thank you @jordanquinnphoto for snapping these images of us — I’m so grateful to be in my @flodesk era! #flodesk #communityovercompetition
